import React from "react";

import "./ServicesPage.css";
import yandexLogo from "../../images/Yandex_logo_Cyrillic.svg";
import ServicesItem from "../../components/ServicesItem/ServicesItem";
import logo from "../../images/uya_logo.svg";

const ServicesPage = () => {

    const services = [
        [lo, "Поиск", "Ответы на любые вопросы"],
        ["ya_logo.svg", "Картинки", "Изображения всех цветов и размеров"],
        ["ya_logo.svg", "Видео", "Просмотр фильмов, сериалов, телешоу, музыкальных роликов"]
    ];

    return (
        <section id="services-page">
            <header>
                <img src={ yandexLogo } alt="" />
                <div id="services-links">
                    <a href="a">Сервисы</a>
                    <a href="a">Приложения</a>
                    <a href="a">Программы</a>
                    <a href="a">Для бизнеса</a>
                </div>
            </header>
            <div className="service-items-list">
                {services.map((list) => (
                     <ServicesItem img={list[0]} header={list[1]} desc={list[2]} />
                ))}
            </div>
        </section>
    );
}

export default ServicesPage;
